let vm=new Vue({vuetify:vuetify,el:"#app-container",data:{search:"",tab:null,nav_tab:null,loading:!1,my_courses_loading:!1,my_orders_loading:!1,courses_loading:!1,existsChildCourses:!1,snackbar:!1,snackbar_timeout:4e3,snackbar_text:"",alert:!1,alert_type:"",alert_message:"",notifications:[],courses:[],children:new Children({uid:uid})},computed:{},created(){check_google_user(),this.children.load(),this.loadLatestCourses()},watch:{},mounted(){},methods:{filterLatestCourses(e){var s=this,t=s.children,r=t.children_courses.filter((s,t)=>s.user_id==e);return null!=r.length&&!s.existsChildCourses&&(s.existsChildCourses=!0),null!=r.length?r.slice(0,3):[]},loadLatestCourses(){var e=this,s=api_url+"courses/get";e.courses_loading=!0,e.$http.get(s).then(s=>{e.courses_loading=!1,e.courses=s.body},e=>{})}}});